INSERT INTO animal.post (user_id, animal_id, title, type, status, timestamp, city, county, address, info) VALUES (2, 1, 'Tore Sakslane', 'F', 'A', '2024-04-28 23:13:56.942252', 'Tallinn', 'Harju maakond', 'Lambakoera põik 22', 'Kadunud Saksalambakoer nimega Bruno. Ta armastab viineripirukaid ja usub, et on kass. Kui näete, teavitage meid. Aitäh!');
INSERT INTO animal.post (user_id, animal_id, title, type, status, timestamp, city, county, address, info) VALUES (2, 2, 'Sõbralik kass', 'F', 'A', '2024-04-28 23:19:26.330512', 'Tallinn', 'Harju maakond', 'Garfieldi tänav 73', 'Kadunud Briti lühikarvaline kass nimega Sir Whiskers. Ta on armas ja uudishimulik, alati valmis avastama uusi seiklusi oma naabruskonnas. Kui olete teda näinud, andke teada. Aitäh!');
INSERT INTO animal.post (user_id, animal_id, title, type, status, timestamp, city, county, address, info) VALUES (2, 3, 'Kondama läinud Nastik', 'L', 'A', '2024-04-28 23:23:36.642025', 'Pärnu', 'Pärnu maakond', 'Mao tänav 12', 'Kadunud Nastik nimega Nupsik! Kui olete teda näinud, palun andke teada. Ta vastab ka nimele "Napakas" ja armastab peita end kõige ebatavalisematesse kohtadesse, nagu sokkide sisse või raamaturiiulitesse. Aitäh teile, kes aitate meil seda libekesta leida!');
INSERT INTO animal.post (user_id, animal_id, title, type, status, timestamp, city, county, address, info) VALUES (2, 4, 'Lõbus siiam', 'F', 'A', '2024-04-29 00:20:46.544348', 'Võru', 'Võru maakond', 'Võru mnt 123', 'Leitud Siiaami kass! Nagu koomiline teatraal – suured silmad ja veidi segased trikid. Tema seiklusjanu on suurem kui ta enese tarkus, kuid vähemalt on ta tagasi! Aitäh, et teda meile tõid!');
INSERT INTO animal.post (user_id, animal_id, title, type, status, timestamp, city, county, address, info) VALUES (2, 5, 'Pirakas Maine Coon', 'F', 'A', '2024-04-29 00:23:18.139583', 'Põlva', 'Põlva maakond', 'Kassi põik 12', 'Leitud Maine Coon! Ta on nagu looduslik peatumatu jõud, suur kass maailmas täis väikesi seiklusi. Tema sabal on rohkem elu kui telesaate finaalis. Ta on nagu karvane vürst, kes ei märka, kuidas ta käpad mööda diivanit lohistavad. ');
INSERT INTO animal.post (user_id, animal_id, title, type, status, timestamp, city, county, address, info) VALUES (2, 6, 'Vahva sõbralik Bengal', 'F', 'A', '2024-04-29 00:25:08.537068', 'Kärdla', 'Hiiu maakond', 'Vurru tee 19', 'Leitud Bengali kass! Nagu väike džungliavastaja, triibuline ja uhke. Ta on segaduses, kas jahti pidada või diivanil mõnuleda.');
INSERT INTO animal.post (user_id, animal_id, title, type, status, timestamp, city, county, address, info) VALUES (2, 7, 'Armas Kutsikas', 'F', 'A', '2024-04-29 00:27:09.452565', 'Rapla', 'Rapla maakond', 'Käpa tänav 11', 'Leitud kuldne retriiveri kutsikas! Ta on nagu päikesepaiste pudelis - alati särav ja täis rõõmu. Tema karvkate on pehme nagu unistus ning tema saba liputab rõõmsalt nagu peomajakas. Ta on nagu väike elutorm, kes võib muuta tuima päeva erksaks. ');
INSERT INTO animal.post (user_id, animal_id, title, type, status, timestamp, city, county, address, info) VALUES (2, 8, 'Nastikupoiss', 'F', 'A', '2024-04-29 00:28:31.415511', 'Tartu', 'Tartu maakond', 'Lõgismao 12', 'Leitud lõbus nastik! Ta on nagu valla pääsenud suleline akrobaat - painduv, üllatav ja alati valmis keerutama. Tema trikid on rohkem kui lihtsalt uskumatud - nad on peaaegu nagu maagia! Ta on nagu elav spagetijupp, kes otsib igavesti oma ümara kodu otsa. ');
INSERT INTO animal.post (user_id, animal_id, title, type, status, timestamp, city, county, address, info) VALUES (2, 9, 'Vahva taks', 'F', 'A', '2024-04-29 00:30:16.385493', 'Kuressaare', 'Saare maakond', 'Lossi põik 44', 'Leitud taksi! Ta on nagu väike auto, kes on unustanud, et tal on käigukang. Tema jalutuskäigud on lühikesed, kuid tema seiklused on suured. Ta on nagu elav takso, kes ootab alati oma järgmist reisijat.');
INSERT INTO animal.post (user_id, animal_id, title, type, status, timestamp, city, county, address, info) VALUES (2, 10, 'Leitud arglik Kolli', 'F', 'A', '2024-04-29 00:32:43.915360', 'Tallinn', 'Harju maakond', 'Aia tee 7', '"Leitud kolli! Ta on nagu elav kott segadust - alati valmis mängima peitust omaenda sabaga. Tema silmad on suuremad kui tema pahandused ning tema kiire liikumine tekitab mulje, et ta on pidevalt üheks segaduseks teise järel. ');
